	(16, 6417, NULL, 'Jollibee Sarap ng Pasko Big Order Service (JSPB) Program', 'Book your Christmas party now and avail of the 10% giftback* for a minimum single-receipt food purchase worth P5,501.\r\n\r\nOffer is valid for bookings from November 15 to December 31, 2022.\r\n\r\nApplicable only to select Christmas bundles, Jolly Kiddie Meals, and solo food items.\r\n\r\nBig order is available via dine-in, take out and delivery via #87000 hotline.\r\n\r\nAvailable at participating Jollibee stores nationwide.\r\n\r\nCannot be used in conjunction with other promos.\r\n\r\nIn the purchase of goods and services which are on promotional discounts, the Senior Citizen can avail of the establishmentÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Â¦Ãƒâ€šÃ‚Â¡ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Â¦Ãƒâ€šÃ‚Â¾ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢s offered discount, or the 20 percent discount provided under Expanded Senior Citizens Act of 2010, whichever is higher and more favorable.\r\n\r\nDTI Fair Trade Permit No. FTEB-154670 Series of 2022.\r\n\r\n*Giftback may be in a form of Jollibee Gift Certificates or products, whichever may be availed by the customer and requested through the JSPB-serving store.', 'promo', 'uploads/media/brand/products/promo-8.jpg', 'uploads/media/brand/products/promo-8.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:39:42', '2023-02-02 05:42:59', '2023-02-02 05:42:59'),
