	(968, 1, 'Martyr or Murderer', 'Through the eyes of Imee Marcos, Maid in MalacaÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â±ang chronicles the final days of The Marcos family before they were airlifted out of Malacanang and flown to Hawaii. Following the record-smashing success of its prequel, Martyr or Murderer recounts what happened to the family before and after EDSA Revolution, a sneak peak to their Life in Exile and a brave discussion on the intrigues surrounding Imee\\\'s exploits in Morroco -- did she really go into hiding and forge passports? How did her siblings cope with the sudden turn of events? How did the ailing patriarch and his Imeldific wife carry on with their lives after being stripped of power and dignity? \r\n\r\nMOM carries the lovestory of Imelda and Ferdinand, the union of Politics and Philippine Culture, It also solves the riddles about the duplicity of Ninoy Aquino, his relationship with people around him, his ulterior motivations and how his untimely death--which is still being pinned on his rival Ferdinand--was used to catalyze the downfall of the Marcoses. How did all the strife between these two luminaries start, how far did it go? To what extent can a man lie to himself in pursuit of his dreams? Who is the real Martyr, who is the real Murderer? This movie holds the answers.', '2023-03-01', 'PG', '', 103, 'Ella Cruz, Cesar Montano, Ruffa Gutierrez, Cristine Reyes, Diego Loyzaga, Isko Moreno, ', 'https://www.youtube.com/watch?v=OaLV1YSY_q4', NULL, '0000002102', 20100618432316901, 'Cinema 7', 'HO00000352', '0000000004', NULL, NULL, '2023-03-15 16:00:00', '2023-03-15 06:59:32', '2023-03-15 06:59:32'),
