	(188, '2023-04-26 10:56:51', '2022-08-11 05:24:30', 'admin/site/update', 3, 'Admin', 3, 'Bautista, King', 1, 'update `sites` set `sites`.`updated_at` = ? where `id` = ?', ' [2023-04-26 14:58:13, 1]', '2023-04-26 06:58:13', '2023-04-26 06:58:13', NULL),
	(189, '2023-04-26 10:56:51', '2022-08-11 05:24:30', 'admin/site/update', 3, 'Admin', 3, 'Bautista, King', 1, 'update `sites` set `descriptions` = ?, `is_default` = ?, `sites`.`updated_at` = ? where `id` = ?', ' [SM Megamall is the third largest shopping center in the country and one of SM\'s premier malls. It is the launchpad for first and new experiences in shopping, dining, leisure and events. It is located at the heart of EDSA and part of the Ortigas\' bustling CBD with foot traffic averaging from 300,000 to 500,000 daily. It is currently ranked as one of the largest malls in the country by floor area measuring 474,224.86 square meters of total retail floor area and 13th largest in the world.  \r\n \r\nAs one of SMÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s showcase malls, SM Megamall is home to over 1,000 stores with over 200 restaurants. SM Megamall is currently composed of buildings ie. Mega A, Mega B, Mega Carpark C, Mega Atrium and Mega Fashion hall. It hosts one of the biggest SM Store, two SM Supermarkets, one of the largest food courts in the metro and the Mega Food Hall. There are twelve state of art digital cinemas, an IMAX Theater and a DirectorÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s Club. A chapel, an Olympic-sized ice skating rink and a fully computerized 14-lane bowling alley, an art center, 3 large exhibition halls and a dedicated IT hub called the SM Cyberzone and 3 event centers.  \r\n \r\nThe Mega Fashion Hall opened last January 28, 2014 and is home to the flagship stores of H&M, Uniqlo and Zara, as well as the home of global brands such as SpainÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s Pull and Bear and furniture giant, Crate and Barrel. Located at the newest wing of SM Megamall is also home to exciting international dining concepts such as Hong KongÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s Michelin Star Dimsum restaurant Tim Ho Wan, Din Tai Fung, and KamÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s Roast, the first Saint MarcÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s CafÃƒÆ’Ã‚Â© and Ippudo of Japan, Nara Thai Cuisine from Bangkok, the Famous Panda Express of USA, firs in the mall Shake Shack to name a few. The mall is also known for its homegrown brands such as, Yabu, Tuan Tuan, 8 Cuts and more.\r\n \r\nSM MegamallÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s accolades include 5 years of winning the Philippine Retail Association\'s (PRA) Shopping Center of the Year bringing it to Hall of Fame and is consistently the Top Taxpayer Awardee of Mandaluyong City for 2014 to date and Southeast Asia Property Awards for Best Architectural Design for the Mega Fashion Hall. Further, SM Megamall was also certified and given the Certification 22301-2012 (Business Continuity Management System) last October 2015 by TUV SUD Singapore.\r\n\r\nExciting activities await you and your family and friends at SM Megamalll! Keep updated with our latest events and promotions., 0, 2023-04-26 14:58:13, 1]', '2023-04-26 06:58:13', '2023-04-26 06:58:13', NULL),
	(190, '2023-04-26 10:56:51', '2022-08-11 05:24:30', 'admin/site/update', 3, 'Admin', 3, 'Bautista, King', 30, 'update `sites` set `sites`.`updated_at` = ? where `id` = ?', ' [2023-04-26 14:59:42, 30]', '2023-04-26 06:59:42', '2023-04-26 06:59:42', NULL),
	(191, '2023-04-26 10:56:51', '2022-08-11 05:24:30', 'admin/site/update', 3, 'Admin', 3, 'Bautista, King', 30, 'update `sites` set `descriptions` = ?, `sites`.`updated_at` = ? where `id` = ?', ' [The 75th SM Supermall, SM CITY BUTUAN is located along JC Aquino Avenue and is the first SM mall development in the CARAGA Region.\r\n\r\nSM City Butuan will be hosting a diverse mix of international fashion brands and local concepts. It is a world class shopping center with 175 stores and dining establishments. The 3 storey mall will also have a bank and other service outlets to choose from. Mall features include a rooftop parking space and a helipad.\r\n\r\nExciting activities await you and your family and friends at SM City Butuan! Keep updated with our latest events and promotions., 2023-04-26 14:59:42, 30]', '2023-04-26 06:59:42', '2023-04-26 06:59:42', NULL),
