	(202, '2023-04-26 10:56:51', '2022-08-11 05:24:30', 'admin/site/update', 3, 'Admin', 3, 'Bautista, King', 23, 'update `sites` set `descriptions` = ?, `site_logo` = ?, `site_banner` = ?, `sites`.`updated_at` = ? where `id` = ?', ' [It all began here. SM City North EDSA innovated and institutionalized the "one-stop shopping complex" and was the first mall in the Philippines to introduce "malling" as a pastime. Besides being a haven for shoppers, the architecture of the mall blends both old and new, creating calming and colorful scenes.\r\n\r\nWith world-class cinemas, a helpful and convenient transport depot for easy commuting, outdoor parking, and attractive structures, SM City North EDSA aims to be an architectural landmark of Metro ManilaÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s progress, as well as one of the most beautiful structures in the Philippines. The mall complex composed of 6 major buildings namely The Block, Annex, Skygarden, City Center, Interior Zone, and Northlink.\r\n\r\nIt features SM Store, its major anchor, SM Supermarket, a Hypermarket, a food court, a Skygarden, an Amphitheater which is an entertainment stage for events with more than 1,500 seats, a 12-cinema complex, and over 800 shops. It offers more than 4,000 parking slots and valet services on 3 strategic locations.\r\n\r\nTruly, more fun, dining, and celebration experiences await everyone everyday at SM City North Edsa!! Keep updated with our latest events and promotions., uploads/media/sites/logos/logo-smne.png, uploads/media/sites/banners/about-us-smtz.jpg, 2023-04-26 15:05:37, 23]', '2023-04-26 07:05:37', '2023-04-26 07:05:37', NULL),
